description:
Overwhored is a pornographic parody of the Overlord series of games. The game is a classic RPG in the vein of Final Fantasy or Chrono Trigger. In it you play the resurrected Overmind, out to conquer the world and capture all heroines!

The game has high quality hand drawn art. 

